import { Link } from 'react-router-dom';
import './Homepage.css'

function HomePage(){

    
    return(
      <>
      <div class='content'>
        <p className='login'>Belépés</p>
        <button>Vendégként</button>
        <button>Szerkesztőként</button>
      </div>
      </>
    )
    
  }
  
  
  
  export default HomePage
